{
  "query": "mutation ($input: BaseFactSheetInput!, $patches: [Patch]!) { createFactSheet(input: $input, patches: $patches) { factSheet { id name tags { id name tagGroup { name } } type ... on Platform { description name } } } }",
  "variables": {
    "input": {
      "name": "${property.GlobalAccount_Level1_displayName}",
      "type": "Platform"
    },
    "patches": [
      {
        "op": "add",
        "path": "/tags",
        "value": "[{\"tagName\":\"${property.GlobalAccount_Level1_commercialModel}\"}, {\"tagName\":\"${property.GlobalAccount_Level1_licenseType}\"}]"
      },
      {
        "op": "add",
        "path": "/description",
        "value": "Global Account FactSheet created automatically by SAP Integration Suite."
      },
      {
        "op": "add",
        "path": "/externalId",
        "value": "{\"type\":\"ExternalId\",\"externalId\":\"${property.GlobalAccount_Level1_guid}\"}"
      },
      {
        "op": "add",
        "path": "/relToParent/new_1",
        "value": "{\"factSheetId\":\"${property.FactSheetID}\"}"
      },
      {
        "op": "add",
        "path": "/alias",
        "value": "${property.GlobalAccount_Level1_subdomain}"
      }
    ]
  }
}

